import React from 'react'; 
import {Link} from 'react-router-dom';


const Sample = () => {
    return(
        <div>
            <h2>Sample Page</h2>
            <Link to='/test'>
                <button id="teststartbttn">검사 시작</button>
            </Link> 
        </div>
    )
}


export default Sample;
